import React, { PureComponent } from "react";
import Head from "next/head";
import { Line } from "@ant-design/plots";

import AppLayout from "../components/AppLayout";
const data = [
  { name: "G2", star: 10371 },
  { name: "G6", star: 7380 },
  { name: "F2", star: 7414 },
  { name: "L7", star: 2140 },
  { name: "X6", star: 660 },
  { name: "AVA", star: 885 },
  { name: "G2Plot", star: 1626 },
];
const Profile = () => {
  const config = {
    data,
    xField: "year",
    yField: "value",
    point: {
      shapeField: "square",
      sizeField: 4,
    },
    interaction: {
      tooltip: {
        marker: false,
      },
    },
    style: {
      lineWidth: 2,
    },
  };

  return (
    <AppLayout>
      <Head>
        <title>NTB</title>
      </Head>
      <div>운동</div>
      <Line {...config} />
    </AppLayout>
  );
};

export default Profile;
